import styled from 'styled-components';

export const Container = styled.nav`
    padding: 1rem 5rem;
    display: flex;
    align-items: center;
    flex-wrap: wrap;
    div{
      display: flex;
      justify-content: space-between;
      align-items: center;
      position: center;
    }
    a{
      text-align: center;
      font-size: 0.3rem;
      font-weight: 600;
      letter-spacing: 0px;
      color: #071242;
      opacity: 1;
      text-decoration: none;
      cursor: pointer;
      & + a{
        margin-left: 2rem;
      };
    };
`
